import Navigation from '../../components/navbar';
import logo from '../../logo.svg';
import './Tips.css';

function Main() {
  return (
    <div className="Tips">
      <nav>
        <Navigation />
      </nav>
      <header className="App-header">
        <p>
          Can yall see this?
        </p>
        <h1>Tips</h1>
      </header>
    </div>
  );
}

export default Main;
